message:
This code crashes: Need to fix the sort call in roomNovelties

@jakeryang I'll take one more shot at this, but fixing the Comparator definition is the trick.

However, another alternative would be to go into where the code loads rooms into a HashMap and use a data structure that stores things in a deterministic order ... not sure how much of an efficiency hit that would cause.

I restored this test

Now that the non-determinism is fixed, this test passes, which means that it should always pass on all machines. We'll see ... at least if it breaks now, we'll be able to look at the specific level.

@jakeryang For example, after you add the raft, the levels will behave differently, but hopefully the test will still pass.

Change randomUUID

Made the UUID's reproducible, but this still doesn't make the Maven jar match the Eclipse launch. The room ID numbers diverge almost immediately. How is this possible?

@jakeryang Are there any other sources of randomness that don't rely on the RandomNumbers class? Did you use any other classes or libraries that generate any kind of random Strings? We'll never be able to properly troubleshoot if we don't solve the determinism problem.

Removed Math.random

@jakeryang I found some uses of Math.random in code that might be used by the simulation. Will removing this fix all sources of non-determinism? We'll see.

Send me a picture of what running the GAN with seed 0 looks like for you. Maybe out levels will finally be in agreement.

